apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  name: webserver-operator.v1.0.35
  namespace: placeholder
  annotations:
    categories: Application Runtime
    capabilities: Basic Install
    description: An Ansible-based operator that deploys NGINX or Apache based on a WebServer CR.

    # OLM bundle metadata #
    operators.operatorframework.io.bundle.package.v1: webserver-operator
    operators.operatorframework.io.bundle.channels.v1: stable
    operators.operatorframework.io.bundle.channel.default.v1: stable

    # Operator image (pinned)
    containerImage: quay.io/philip860/webserver-operator@sha256:e7adf2031f13cd83514d460b123236100d89cd9c6aa9a08415086ba74c3dfb97

    # Console sample CR
    alm-examples: >-
      [
        {
          "apiVersion": "example.com/v1alpha1",
          "kind": "WebServer",
          "metadata": { "name": "example-webserver" },
          "spec": {
            "type": "nginx",
            "replicas": 1,
            "port": 8080
          }
        }
      ]

    # Required feature flags (must be strings "true"/"false")
    features.operators.openshift.io/disconnected: "false"
    features.operators.openshift.io/fips-compliant: "false"
    features.operators.openshift.io/proxy-aware: "false"
    features.operators.openshift.io/tls-profiles: "false"
    features.operators.openshift.io/token-auth-aws: "false"
    features.operators.openshift.io/token-auth-azure: "false"
    features.operators.openshift.io/token-auth-gcp: "false"

    # Bundle layout
    operators.operatorframework.io.bundle.mediatype.v1: registry+v1
    operators.operatorframework.io.bundle.manifests.v1: manifests/
    operators.operatorframework.io.bundle.metadata.v1: metadata/

    # Allow clusters on older 1.0.x releases to upgrade directly to 1.0.35
    # even if intermediate versions are missing from some catalog/index builds.
    olm.skipRange: ">=1.0.0 <1.0.35"

