  keywords:
    - nginx
    - apache
    - webserver
    - ansible
  relatedImages:
    - name: webserver-operator
      image: quay.io/philip860/webserver-operator@sha256:e7adf2031f13cd83514d460b123236100d89cd9c6aa9a08415086ba74c3dfb97
  install:
    strategy: deployment
    spec:
      deployments:
        - name: webserver-operator
          spec:
            selector:
              matchLabels:
                name: webserver-operator
            replicas: 1
            template:
              metadata:
                labels:
                  name: webserver-operator
              spec:
                serviceAccountName: webserver-operator
                containers:
                  - name: ansible-operator
                    image: quay.io/philip860/webserver-operator@sha256:e7adf2031f13cd83514d460b123236100d89cd9c6aa9a08415086ba74c3dfb97
                    imagePullPolicy: Always
                    env:
                      - name: WATCH_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.annotations['olm.targetNamespaces']
                      - name: POD_NAME
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.name
                      - name: OPERATOR_NAME
                        value: webserver-operator
                      - name: WEBSERVER_OPERATOR_VERSION
                        value: "v1.0.35"
      permissions:
        - serviceAccountName: webserver-operator
          rules:
            - apiGroups:
                - example.com
              resources:
                - webservers
                - webservers/status
                - webservers/finalizers
              verbs:
                - get
                - list
                - watch
                - create
                - update
                - patch
                - delete
            - apiGroups:
                - apps
              resources:
                - deployments
                - replicasets
              verbs:
                - get
                - list
                - watch
                - create
                - update
                - patch
                - delete
            - apiGroups:
                - ''
              resources:
                - pods
              verbs:
                - get
                - list
                - watch
            - apiGroups:
                - ''
              resources:
                - services
                - configmaps
                - secrets
              verbs:
                - get
                - list
                - watch
                - create
                - update
                - patch
                - delete
            - apiGroups:
                - ''
              resources:
                - events
              verbs:
                - create
                - patch
                - update
            - apiGroups:
                - route.openshift.io
              resources:
                - routes
              verbs:
                - get
                - list
                - watch
                - create
                - update
                - patch
                - delete
      clusterPermissions:
        - serviceAccountName: webserver-operator
          rules:
            - apiGroups:
                - ''
              resources:
                - namespaces
              verbs:
                - get
                - list
                - watch
            - apiGroups:
                - route.openshift.io
              resources:
                - routes
              verbs:
                - get
                - list
                - watch
  customresourcedefinitions:
    owned:
      - name: webservers.example.com
        version: v1alpha1
        kind: WebServer
        displayName: WebServer
        description: Custom resource that declares an Apache or NGINX deployment.
  installModes:
    - type: OwnNamespace
      supported: true
    - type: SingleNamespace
      supported: true
    - type: MultiNamespace
      supported: false
    - type: AllNamespaces
      supported: true
